const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/dashboard" element={<DashboardRoutes />} />
        <Route path="/" element={<Login />} />
      </Routes>
    </Router>
  );
};

const DashboardRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<Dashboard />} />
      {/* Add more nested routes for dashboard components */}
    </Routes>
  );
};

export default App;
